import React from 'react'

export default function Sublist() {
    return (
        <span className="sublist">
            <NavLink to="/Wbnx1" className="navlink">WBN_X1</NavLink>
            <NavLink to="/Wbnx2" className="navlink">WBN_X2</NavLink>
            <NavLink to="/Wbnx3" className="navlink">WBN_X3</NavLink>
        </span>
    )
}
